import menu from "./images/open-menu.png"
import logo from "./images/logo_about.png"
function Nav() {
const show = false;
  const navHandler= ()=>{
   if(show == false){
    show = true;
   }
   if(show == true){
    show = false;
   }
  }
  return (
    <div>
    <div className="w-full  h-16 md:h-20 bg-white shadow-2xl flex justify-center items-center fixed  ">
      <div className="flex flex-row w-full px-3 md:mx-12 ">
        <div className="w-1/3  ">
          <img className="w-20" src={logo} />
        </div>
        <div className="w-2/3 flex flex-row justify-end gap-20  invisible  lg:visible">
          <div>Courses</div>
          <div>Services</div>
          <div>Blogs</div>
          <div>About us</div>
        </div>

        <div className="xl:invisible relative flex items-center">
          <img className="w-10 h-8" onClick={navHandler} src={menu} />

        </div>
      </div>
    </div>
    <div className="w-auto h-auto absolute p-5 bg-gray-600 ">
    <div>Courses</div>
    <div>Services</div>
    <div>Blogs</div>
    <div>About us</div>
  </div>
  </div>
  );
}

export default Nav;
